import './statics/css/AppLogin.css'

var AppLogin = props=>{
    return (
        <div className="login">
            <div className="form">
                <h1 align='center'>Login</h1>
                <form method = 'POST'>
                    <div id="username"><input  type="text"  placeholder = 'Username or Email' /></div>
                    <div id="password"><input type="password"   placeholder= "Password" /></div>
                    {/* <input className='login' type="submit"  value= 'Login' /> */}
                </form>
            </div>
        </div>
    )
}


export default AppLogin;
